import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";

(function () {
  var firstScript = document.getElementsByTagName("script")[0]
  if (document.getElementById("applet-js-sdk")) {
    return
  }
  var sdk = document.createElement("script")
  sdk.id = "applet-js-sdk"
  sdk.src = "https://connect.facebook.net/en_US/fbapplet.latest.js";
  //sdk.src = 'https://connect.facebook.net/en_US/fbinstant.6.3.js'
  sdk.onload = initializeApp;
  firstScript.parentNode.insertBefore(sdk, firstScript)
})();

function initializeApp() {
  console.log('sdk loaded')
  window.FBApplet.initializeAsync()
    .then(function() {
      console.log('initializeAsync resolved')
      window.FBApplet.startGameAsync().then(function() {
        console.log('startGameAsync resolved')
        startApp()
      })
    })
    .catch((err) => {
      console.log(err);
    });
}

function startApp() {
  console.log('start app')
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById("root")
  );
}

// If you want to start measuring performance in your app, pass a function
